import React from 'react';
import { BrowserRouter as Router, Route, Routes, NavLink } from 'react-router-dom';
//import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
//import { BrowserRouter as Router, Route, Switch, NavLink } from 'react-router-dom';
import './App.css';
import Home from './components/Home';
import Explore from './components/Explore';
import Notifications from './components/Notifications';
import Messages from './components/Messages';
import Profile from './components/Profile';

function App() {
  return (
    <Router>
      <div className="App">
        <div className="content">
          <Routes>
			<Route path="/" component={<Home />} />
			<Route path="/explore" component={<Explore />} />
			<Route path="/notifications" component={<Notifications />} />
			<Route path="/messages" component={<Messages />} />
			<Route path="/profile" component={<Profile />} />
            <Route path="/explore" component={Explore} />
          </Routes>
        </div>
        <nav className="bottom-menu">
          <NavLink exact to="/" className="bottom-menu-item" activeClassName="active">
            Home
          </NavLink>
          <NavLink to="/explore" className="bottom-menu-item" activeClassName="active">
            Explore
          </NavLink>
          <NavLink to="/notifications" className="bottom-menu-item" activeClassName="active">
            Notifications
          </NavLink>
          <NavLink to="/messages" className="bottom-menu-item" activeClassName="active">
            Messages
          </NavLink>
          <NavLink to="/profile" className="bottom-menu-item" activeClassName="active">
            Profile
          </NavLink>
        </nav>
      </div>
    </Router>
  );
}

export default App;
